import React from "react"

const Error = ({ errorMsg }) => (
    <div className="alert alert-danger">
        <p>
            <li className="fas fa-exclamation-triangle text-danger">&nbsp;</li>&nbsp;
            We've encountered an error: {errorMsg}
        </p>
    </div>
)

export default Error;
